    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    // Info of each user.
    struct UserInfo {
        uint256[] tokenIds;
        uint256 amount; // How many LP tokens the user has provided.
        uint256 rewardDebt; // Reward debt. See explanation below.
        //
        // We do some fancy math here. Basically, any point in time, the amount of DRGs
        // entitled to a user but is pending to be distributed is:
        //
        //   pending reward = (user.amount * pool.accDRGPerShare) - user.rewardDebt
        //
        // Whenever a user deposits or withdraws LP tokens to a pool. Here's what happens:
        //   1. The pool's `accDRGPerShare` (and `lastRewardBlock`) gets updated.
        //   2. User receives the pending reward sent to his/her address.
        //   3. User's `amount` gets updated.
        //   4. User's `rewardDebt` gets updated.
    }
    // Info of each pool.
    struct PoolInfo {
        IERC721 NFTToken; // Address of LP token contract.
        uint256 allocPoint; // How many allocation points assigned to this pool. DRGs to distribute per block.
        uint256 lastRewardBlock; // Last block number that DRGs distribution occurs.
        uint256 accDRGPerShare; // Accumulated DRGs per share, times 1e12. See below.
    }

    INFTMasterChef public NFTMasterChef;

    // The DRG TOKEN!
    IERC20 public DRG;
    // Dev address.
    address public devaddr;
    // DRG tokens created per block.
    uint256 public DRGPerBlock;
    // Bonus muliplier for early DRG makers.
    uint256 public BONUS_MULTIPLIER = 1;
    // The migrator contract. It has a lot of DRG. Can only be set through governance (owner).
    IMigratorChef public migrator;
    // Info of each pool.
    PoolInfo[] public poolInfo;
    // Info of each user that stakes LP tokens.
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    // Total allocation poitns. Must be the sum of all allocation points in all pools.
    uint256 public totalAllocPoint = 0;
    // The block number when DRG mining starts.
    uint256 public startBlock;

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );

    constructor(
        IERC20 _DRG,
        INFTMasterChef _NFTMasterChef,
        address _devaddr,
        uint256 _DRGPerBlock,
        uint256 _startBlock
    ) {
        DRG = _DRG;
        NFTMasterChef = _NFTMasterChef;
        devaddr = _devaddr;
        DRGPerBlock = _DRGPerBlock;
        startBlock = _startBlock;
    }

    /**
     * Always returns `IERC721Receiver.onERC721Received.selector`.
     */
    function onERC721Received(address, address, uint256, bytes memory) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function updateMultiplier(uint256 multiplierNumber) public onlyOwner {
        BONUS_MULTIPLIER = multiplierNumber;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    // Add a new lp to the pool. Can only be called by the owner.
    // XXX DO NOT add the same LP token more than once. Rewards will be messed up if you do.
    function add( uint256 _allocPoint, IERC721 _NFTToken, bool _withUpdate ) public onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        uint256 lastRewardBlock = block.number > startBlock ? block.number : startBlock;
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        poolInfo.push(
            PoolInfo({
                NFTToken: _NFTToken,
                allocPoint: _allocPoint,
                lastRewardBlock: lastRewardBlock,
                accDRGPerShare: 0
            })
        );
    }

    // Update the given pool's DRG allocation point. Can only be called by the owner.
    function set( uint256 _pid, uint256 _allocPoint, bool _withUpdate) public onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        totalAllocPoint = totalAllocPoint.sub(poolInfo[_pid].allocPoint).add(_allocPoint);
        poolInfo[_pid].allocPoint = _allocPoint;
    }

    // Set the migrator contract. Can only be called by the owner.
    function setMigrator(IMigratorChef _migrator) public onlyOwner {
        migrator = _migrator;
    }

    // Return reward multiplier over the given _from to _to block.
    function getMultiplier(uint256 _from, uint256 _to) public view returns (uint256) {
         return _to.sub(_from).mul(BONUS_MULTIPLIER);
    }

    function getUserTokenIds(uint256 _pid, address _user) public view returns (uint256[] memory) {
        UserInfo storage user = userInfo[_pid][_user];
        return user.tokenIds;
    }

    // View function to see pending DRGs on frontend.
    function pendingDRG(uint256 _pid, address _user) external view returns (uint256){
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_user];
        uint256 accDRGPerShare = pool.accDRGPerShare;
        uint256 NFTSupply = pool.NFTToken.balanceOf(address(this));
        if (block.number > pool.lastRewardBlock && NFTSupply != 0) {
            uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
            uint256 DRGReward = multiplier.mul(DRGPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
            accDRGPerShare = accDRGPerShare.add(DRGReward.mul(1e12).div(NFTSupply));
        }
        return user.amount.mul(accDRGPerShare).div(1e12).sub(user.rewardDebt);
    }

    // Update reward vairables for all pools. Be careful of gas spending!
    function massUpdatePools() public {
        uint256 length = poolInfo.length;
        for (uint256 pid = 0; pid < length; ++pid) {
            updatePool(pid);
        }
    }

    // Update reward variables of the given pool to be up-to-date.
    function updatePool(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        if (block.number <= pool.lastRewardBlock) {
            return;
        }
        uint256 NFTSupply = pool.NFTToken.balanceOf(address(this));
        if (NFTSupply <= 0) {
            pool.lastRewardBlock = block.number;
            return;
        }
        uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
        uint256 DRGReward = multiplier.mul(DRGPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
        DRG.mint(address(this), DRGReward);
        pool.accDRGPerShare = pool.accDRGPerShare.add(DRGReward.mul(1e12).div(NFTSupply));
        pool.lastRewardBlock = block.number;
    }

    // Deposit NFT tokens to MasterChef for DRG allocation.
    function deposit(uint256 _pid, uint256 _tokenId) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updatePool(_pid);
        if (user.amount > 0) {
            uint256 pending = user.amount.mul(pool.accDRGPerShare).div(1e12).sub(user.rewardDebt);
            if(pending > 0){
                safeDRGTransfer(msg.sender, pending);
            }
        }
        pool.NFTToken.safeTransferFrom(address(msg.sender), address(this), _tokenId);
        user.amount = user.amount.add(1);
        user.rewardDebt = user.amount.mul(pool.accDRGPerShare).div(1e12);
        user.tokenIds.push(_tokenId);
        emit Deposit(msg.sender, _pid, _tokenId);
    }

    // Withdraw NFT tokens from MasterChef.
    function withdraw(uint256 _pid, uint256 _tokenId) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 pending;
        if(_tokenId == 0){
            updatePool(_pid);
            pending = user.amount.mul(pool.accDRGPerShare).div(1e12).sub(user.rewardDebt);
            if(pending > 0){
                safeDRGTransfer(msg.sender, pending);
            }
            user.rewardDebt = user.amount.mul(pool.accDRGPerShare).div(1e12);
        }else {
            uint256 hasTokenId = 0;
            uint256 tokenIdIndex;
            for(uint256 i; i<user.tokenIds.length; i++){
                if(user.tokenIds[i] == _tokenId){
                    hasTokenId = 1;
                    tokenIdIndex = i;
                }
            }
            require(hasTokenId == 1, "You are not Owner of token id");
            require(user.amount >= 1, "withdraw: not good");
            updatePool(_pid);
            pending = user.amount.mul(pool.accDRGPerShare).div(1e12).sub(user.rewardDebt);
            if(pending > 0){
                safeDRGTransfer(msg.sender, pending);
            }
            user.amount = user.amount.sub(1);
            user.rewardDebt = user.amount.mul(pool.accDRGPerShare).div(1e12);
            delete user.tokenIds[tokenIdIndex];
            pool.NFTToken.safeTransferFrom(address(this), address(msg.sender), _tokenId);
        }
        emit Withdraw(msg.sender, _pid, _tokenId);
    }

    function compundDRG(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updatePool(_pid);
        uint256 pending = user.amount.mul(pool.accDRGPerShare).div(1e12).sub(user.rewardDebt);
        require(pending > 0, "Amount is zero");
        DRG.approve(address(NFTMasterChef), pending);
        NFTMasterChef.enterStaking(pending, msg.sender);
        user.rewardDebt = user.amount.mul(pool.accDRGPerShare).div(1e12);
        emit Withdraw(msg.sender, _pid, pending);
    }

    // Safe DRG transfer function, just in case if rounding error causes pool to not have enough DRGs.
    function safeDRGTransfer(address _to, uint256 _amount) internal {
        uint256 DRGbal = DRG.balanceOf(address(this));
        if (_amount > DRGbal) {
            DRG.transfer(_to, DRGbal);
        } else {
            DRG.transfer(_to, _amount);
        }
    }

    function setDevAddress(address _devaddr) public onlyOwner {
        devaddr = _devaddr;
    }

    function updateDRGPerBlock(uint256 newAmount) public onlyOwner {
        DRGPerBlock = newAmount;
    }
}

